// src/utils/logout.js
import { useNavigate } from 'react-router-dom';

export function logout() {
    //? Kas lege muud viisi selle tegemiseks pole?
    document.cookie = 'token=; expires=Thu, 01 Jan 1970 00:00:00 UTC; path=/';

    const navigate = useNavigate();
    navigate('/Profile');
}
